window.bookSummaryJSON = "<p>Did you know that men secretly use texting as a way to \"pre-screen\" a woman’s romantic value? A woman’s texting habits can reveal a lot about her self-worth, confidence, intelligence, and even her level of class and emotional maturity.</p> <p>Because guys covertly appraise a woman’s relationship potential this way, many women often have no idea that the way they communicate via text is actually sending the wrong message and thus, they unknowingly end up chasing men away.</p> <p>But with this insightful dating audiobook, you’ll learn the texting habits used by high-value women and gain access to a vast collection of irresistible, man-melting text messages that make men EAGER to text you back and desperate to see you again. And because this in-depth guide focuses on how men think, it will give you a distinct advantage over your peers when it comes to texting men.</p> <p>Inside this audiobook, you’re going to learn:</p> <ul> <li>Exactly what to text a guy when he’s stringing you along and only doing the BARE MINIMUM to keep you interested.</li> <li><b>How to use mischievous \"Feisty Girl\" texts to get a man to finally ask you out (or ask you out AGAIN) while making it seem like it was all HIS idea.</b></li> <li>What to do (and what NOT to do) if a guy suddenly stops texting you or starts responding to your texts less and less.</li> <li><b>How to get him to CALL YOU instead of texting all the time.</b></li> <li>What to text a man to \"let him down easy\" but KEEP him interested whenever he sends an inappropriate or overly sexual text.</li> <li><b>Exactly what to text those flaky guys who keep \"coming BACK from the DEAD\" and suddenly start taking an interest in you again.</b></li> <li>A simple method for starting conversations that IMMEDIATELY grabs his attention and makes him EAGER to text you back.</li> <li><b>And much, much more...</b></li> </ul> <p>Get started right away and discover how to text a man to finally get him OFF of his smartphone and ON more dates with you.</p>"; 
